import React from "react";
import { useParams } from "react-router-dom";

function Profile() {
  const params = useParams();
  console.log(params);
  return (
    <div>
      <h1>Votre profil</h1>
      <p>{params.id}</p>
    </div>
  );
}

export default Profile;
